import Index from "./components/Index";

import './App.css';
import { BrowserRouter,Routes,Route } from "react-router-dom";
import ProfilePage from "./components/Profile"
function App() {
  return (
    <>
    <Index/>
     <BrowserRouter>

     <Routes>
       <Route path="profile" element={<ProfilePage/>}></Route>
     </Routes>
     </BrowserRouter>
     </>
  );
}

export default App;
